oxy_webhelp_navlinks = {"ahv_virtual_machine_protection-d22908e21762":{"topics":[{"title":"Protecting AHV virtual machines","shortdesc":"<p class=\"shortdesc\">Assign an SLA Domain to protect an AHV virtual machine.<\/p>","href":"nutanix_ahv\/ahv_protecting_vm.html","attributes":{"data-id":"ahv_protecting_vm"},"menu":{"hasChildren":false},"tocID":"ahv_protecting_vm-d22908e21773","topics":[]},{"title":"Protecting Nutanix clusters","shortdesc":"<p class=\"shortdesc\">Specify an SLA Domain setting for Nutanix clusters to have the setting applied to the         objects and virtual machines contained by the clusters and server.<\/p>","href":"nutanix_ahv\/ahv_protecting_nx_cluster.html","attributes":{"data-id":"ahv_protecting_nx_cluster"},"menu":{"hasChildren":false},"tocID":"ahv_protecting_nx_cluster-d22908e21784","topics":[]},{"title":"SLA Domain assignment to Nutanix categories","shortdesc":"<p class=\"shortdesc\">A Nutanix category groups AHV virtual machines. By assigning an SLA Domain to a         Nutanix category, you can protect the AHV virtual machines in that category.<\/p>","href":"nutanix_ahv\/sla_domain_assignment_nx_categories.html","attributes":{"data-id":"sla_domain_assignment_nx_categories"},"menu":{"hasChildren":false},"tocID":"sla_domain_assignment_nx_categories-d22908e21795","next":"sla_domain_assignment_nx_categories-d22908e21795"},{"title":"SLA Domain assignment options for AHV virtual machines","shortdesc":"<p class=\"shortdesc\">Protect a set of virtual machines by assigning the selected set to an SLA Domain.         Assigning virtual machines to an SLA Domain protects the virtual machines by applying the         data protection policies of the SLA Domain.<\/p>","href":"nutanix_ahv\/ahv_sla_assignment_options.html","attributes":{"data-id":"ahv_sla_assignment_options"},"menu":{"hasChildren":false},"tocID":"ahv_sla_assignment_options-d22908e21828","topics":[]}]}};